import { View, Text } from 'react-native';
import React from 'react';

export default function Header() {
  return (
    <View>
      <View style={{backgroundColor: '#FFFFFF'}}>
        <Image source={require('../assets/logo.png')} />
      </View>
    </View>
  );
}
